{
  "withoutPublish": true,
  "tempDir": "package",
  "fields": ["scripts", "publishConfig"],
  "files": ["**/*.spec.{js,ts}"]
}

import scopes from '@commitlint/config-pnpm-scopes'

export default {
  extends: [
    '@commitlint/config-conventional',
    '@commitlint/config-pnpm-scopes'
  ],
  rules: {
    'body-max-line-length': [0],
    'header-max-length': [0],
    'scope-enum': async (ctx) => {
      const scopeEnum = await scopes.rules['scope-enum'](ctx)

      return [
        scopeEnum[0],
        scopeEnum[1],
        [
          ...scopeEnum[2],
          'deps',
          'dev-deps'
        ]
      ]
    }
  },
  prompt: {
    settings: {
      enableMultipleScopes: true
    }
  }
}

{
  "path": "@commitlint/cz-commitlint"
}

{
  "root": true,
  "extends": "standard",
  "env": {
    "node": true
  },
  "overrides": [
    {
      "files": [
        "packages/*/test{,/*}.js"
      ],
      "env": {
        "mocha": true
      }
    },
    {
      "files": [
        "tools/**/*.ts",
        "packages/**/*.ts"
      ],
      "extends": [
        "@trigen/eslint-config",
        "@trigen/eslint-config/tsm",
        "@trigen/eslint-config/esm",
        "@trigen/eslint-config/jest"
      ],
      "env": {
        "node": true
      }
    }
  ],
  "ignorePatterns": [
    "packages/*/dist/**/*"
  ]
}

{
  "*.{js,cjs,ts}": "eslint --fix"
}

{
  "commit-msg": "pnpm commitlint --edit \"$1\"",
  "pre-commit": "pnpm nano-staged"
}

{
  "bump-minor-pre-major": true,
  "bump-patch-for-minor-pre-major": true,
  "bootstrap-sha": "840d139c40a2c4e773794d794c34bc4dbfde27c2",
  "packages": {
    "packages/conventional-changelog-cli": { "release-as": "" }
  }
}

{
  "compilerOptions": {
    /* Type Checking */
    "strict": true,
    "strictBindCallApply": true,
    "noFallthroughCasesInSwitch": true,
    "noImplicitOverride": true,
    "noImplicitReturns": true,
    "noUnusedLocals": true,
    "noUnusedParameters": true,
    /* Modules */
    "module": "NodeNext",
    "moduleResolution": "NodeNext",
    "resolveJsonModule": true,
    /* Emit */
    "declaration": true,
    "declarationMap": true,
    "inlineSourceMap": true,
    /* Interop Constraints */
    "allowSyntheticDefaultImports": true,
    "isolatedModules": true,
    "verbatimModuleSyntax": true,
    /* Language and Environment */
    "lib": [
      "esnext"
    ],
    "target": "ESNext",
    /* Completeness */
    "skipLibCheck": true
  }
}

import { defineConfig } from 'vite'

export default defineConfig({
  test: {
    coverage: {
      reporter: ['lcovonly', 'text']
    }
  }
})
